import React from "react";

const SignedOut = () => {
  return (
    <header className="signedOut">
      <img className="logo" src="images/logo.png" alt=" raba logo" />
      <nav className="container">
        <ul className="navlinks">
          <li>DISTRIBUTION</li>
          <li>PRICING</li>
          <li>BLOG</li>
        </ul>
        <ul className="navlinks">
          <li>Log In</li>
          <li>
            <button>Sign Up</button>
          </li>
        </ul>
      </nav>
    </header>
  );
};

export default SignedOut;
